          '6 ',
          '7 <span style="color: #148a68;">export default async</span> (_req<span style="color: #ce3559;">:</span> <span style="color: #5854c6;">NextApiRequest</span>, res<span style="color: #ce3559;">:</span> <span style="color: #5854c6;">NextApiResponse</span>) <span style="color: #ce3559;">=></span> {',
